import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="header">
        <button className="login-btn">Login</button>
      </div>
      <div className="button-container">
        <div className="button">
          <img src="logo192.png" alt="Code Editor Logo" />
          <span>Code Editor</span>
        </div>
        <div className="button">
          <img src={PortfolioLogo} alt="Portfolio Logo" />
          <span>Portfolio</span>
        </div>
        <div className="button">
          <img src={StrategyLogo} alt="Strategy Management Logo" />
          <span>Strategy Management</span>
        </div>
      </div>
    </div>
  );
}

export default App;
